    {
      type: 'Feature',
      geometry: {
        type: 'Point',
        coordinates: [-73.968285, 40.785091],
      },
      properties: {
        id: 1,
        name: 'Yoga in the Park',
        date: '2024-07-10',
        time: '10:00 AM',
        host: 'Alice Johnson',
        location: 'Central Park',
        cost: 'Free',
        attendees: 15,
        capacity: 20,
      },
    },
    {
      type: 'Feature',
      geometry: {
        type: 'Point',
        coordinates: [-73.935242, 40.730610],
      },
      properties: {
        id: 2,
        name: 'Coffee and Chat',
        date: '2024-07-12',
        time: '2:00 PM',
        host: 'Bob Smith',
        location: 'Cafe Delight',
        cost: '£5',
        attendees: 10,
        capacity: 15,
      },
    },
    // Add more events as needed
  ],
};

export default EventsData;
